        /// Generate full male name
        /// </summary>
        /// <param name="gender"></param>
        /// <returns></returns>
        public static string Generate(Gender gender)
        {
            return ToCapitals($"{GenerateFirstName(gender)} {GenerateLastName()}");
        }

        /// <summary>
        /// Generate surname
        /// </summary>
        /// <returns></returns>
        public static string GenerateLastName()
        {
            return _lastNames[_random.Next(0, _lastNames.Count)];
        }

        /// <summary>
        /// Generate name
        /// </summary>
        /// <param name="gender"></param>
        /// <returns></returns>
        public static string GenerateFirstName(Gender gender)
        {
            if (gender == Gender.Male)
                return GenerateMaleName();
            return GenerateFemaleName();
        }

        /// <summary>
        /// Get saved name of player
        /// </summary>
        /// <param name="defaultGender">If name is not saved than use gender to generate new one</param>
        /// <returns></returns>
        public static string LoadName(Gender defaultGender = Gender.Male)
        {
            if (PlayerPrefs.HasKey("player_display_name"))
            {
                return PlayerPrefs.GetString("player_display_name");
            }
            else
            {
                return Generate(defaultGender);
            }
        }

        /// <summary>
        /// Save name of player
        /// </summary>
        /// <param name="p_name"></param>
        public static void SaveName(string name)
        {
            PlayerPrefs.SetString("player_display_name", name);
        }

        /// <summary>
        /// Capitalize string
        /// </summary>
        /// <param name="value"></param>
        /// <returns></returns>
        public static string ToCapitals(string value)
        {
            char[] chars = new char[] { ' ' };
            string[] array = value.Split(chars, StringSplitOptions.RemoveEmptyEntries);

            return string.Join(" ", array.Select((i) =>
            {
                return i.First().ToString().ToUpper() + i.Substring(1).ToLower();
            }));
        }
    }

    /// <summary>
    /// Gender
    /// </summary>
    public enum Gender
    {
        Male,
        Female
    }
}
